import React from "react";
import Preloader from "../Common/Preloader/Preloader";


export let WithSuspense = (Component: any) => {

    return (props: any) => {
        <React.Suspense fallback={<Preloader/>}>
            <Component {...props} />
        </React.Suspense>
    }
};
